const Container = styled.div`
    display: flex;
    position: absolute;
    left: 0;
    top: 0;
    width: 100%;
    height: 100%;
    gap: 5px 1%;
`;
const MenuBar = styled.div`
    position: absolute;
    width: 100%;
`;

export default function Menu(){

    // const getMenu = useSelector(state => state.menu)

    return(
        <MenuBar>
            <img src="../image/interface/menu.png" width={"100%"}></img>
            <Container>
                <Wallet></Wallet>
                <Loading></Loading>
                <ShopTurret on={getMenu}></ShopTurret>
                <ShopUnit on={getMenu}></ShopUnit>
                <ShopMain on={getMenu}></ShopMain>
                <Cancel on={getMenu}></Cancel>
            </Container>
        </MenuBar>
    )
}
